import axios from "axios"
import { useState } from "react"

const SubmitForm = () => {

    const [recipient, setRecipient] = useState('')
    const [title, setTitle] = useState('')
    const [message, setMessage] = useState('')

    const handleSubmit = async (e) => {
        
        e.preventDefault()
        
        console.log(recipient)
        console.log(title)
        console.log(message)

    };

    return (

        <form className="submit-form" onSubmit={handleSubmit}>

            <label>Recipient's Name</label>
            <input type="text" onChange={(e) => setRecipient(e.target.value)} value={recipient} placeholder="Enter recipient's name"/>

            <label>Title</label>
            <input type="text" onChange={(e) => setTitle(e.target.value)} value={title} placeholder="Write your title here"/>

            <label>Message</label>
            <input type="text" onChange={(e) => setMessage(e.target.value)} value={message} placeholder="Write your message here"/>

            <button type="submit">Submit</button>

        </form>

    )

}

export default SubmitForm;
